PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE linee (
    id INTEGER PRIMARY KEY,
    nome TEXT NOT NULL,
    comune_partenza TEXT NOT NULL,
    partenza_lat REAL,
    partenza_lng REAL,
    comune_arrivo TEXT NOT NULL,
    arrivo_lat REAL,
    arrivo_lng REAL,
    capienza INTEGER,
    attiva BOOLEAN,
    sabato BOOLEAN,
    domenica BOOLEAN,
    frequenza_giornaliera REAL
);
COMMIT;
